const icon = "data:image/png;base64,"
const blockIcon = "data:image/png;base64,"

class Minecraft {

    server = "http://localhost:8080"

    constructor(runtime) {
        this.runtime = runtime
        alert("This is proof of concept. Plan is to make a full extension.")
    }

    getInfo() {
        return {
            id: "minecraft",
            name: "Minecraft EDU",
            blockIconURI: icon,
            blocks: [
                {
                    opcode: "weather",
                    blockType: "command",
                    blockIconURI: blockIcon,
                    text: "set weather to [type] for [duration] second(s)",
                    arguments: {
                        type: {
                            type: "string",
                            menu: "weather",
                            defaultValue: "clear"
                        },
                        duration: {
                            type: "number",
                            defaultValue: 300
                        }
                    }
                },
                {
                    opcode: "connect",
                    blockType: "command",
                    text: "connect to [server]",
                    arguments: {
                        server: {
                            type: "string",
                            defaultValue: "https://90e4-89-172-108-123.ngrok.io"
                        }
                    }
                },
                {
                    opcode: "execute",
                    blockType: "reporter",
                    blockIconURI: blockIcon,
                    text: "execute [command]",
                    arguments: {
                        command: {
                            type: "string",
                            defaultValue: "/weather?type=clear&duration=60"
                        }
                    }
                }
            ],
            menus: {
                weather: ["clear", "rain", "thunder"]
            }
        };
    }

    weather({ type, duration }) {
        const url = `${this.server}/weather?type=${type}&duration=${duration}`
        fetch(url)
    }

    connect({ server }) {
        this.server = server
    }

    execute({ command }) {
        return fetch(this.server + command)
            .then(response => response.text())
            .catch(error => error)
    }

}

module.exports = Minecraft;